import { BrowserRouter, Routes, Route} from 'react-router-dom'

// Pages & Components
import Home from './pages/Home'
function App()
{
    return(
        <div className="App">
            <BrowerserRouter>
            <div className="pages">
                <Routes>
                    <Route 
                        path="/"
                        element={<Home />}
                    />
                </Routes>
            </div>
            </BrowerserRouter>
        </div>
    );
}

export default App;
